import Spline from '@splinetool/react-spline';
import React from 'react';


const Cardtwo = () => {
  return (
    <div className='w-full bg-white py-30 px-4'>
        <div className='w-[80%] mx-auto my-20 bg-white rounded-3xl drop-shadow-2xl py-3 px-3'>
      <div className='max-w-[1240px] mx-auto grid md:grid-cols-2'>
      <Spline className='w-300' scene="https://prod.spline.design/nOO5PF0FVDVA81Nl/scene.splinecode" />
        <div className='flex flex-col justify-center'>
          <h1 className='md:text-2xl sm:text-1xl text-2xl font-bold px-3 py-3'>You can watch my own proyects here</h1>
          <p className='px-3 '>
          You can watch my own proyects here
          </p>
          <h1 className='text-transparent text-1xl bg-clip-text bg-gradient-to-r from-blue-400 to-blue-600 w-[200px] rounded-md font-medium my-2x mx-3 py-3 text-black'>Get Started</h1>
        </div>
      </div>
      </div>
    </div>
  );
};

export default Cardtwo;
